import React from 'react';

function Testimonials() {
  return (
    <div>
      <h2>What Our Clients Say</h2>
      <div className="testimonial">
        <p>"This construction company exceeded my expectations. The project was completed on time and under budget!"</p>
        <p>- John D.</p>
      </div>
      <div className="testimonial">
        <p>"Amazing craftsmanship and attention to detail. Highly recommend!"</p>
        <p>- Sarah W.</p>
      </div>
    </div>
  );
}

export default Testimonials;
